(6, 'Oldies', 'The Music Of Our Ancestors', 'A literal reading of the prehistory of music begins about 40,000 years ago, with Europe on the brink of a momentous change. The region was then home to the Neanderthals, who had inherited it from earlier human species stretching back a million years. But now a new species of human - our own - was racing across Europe. Homo sapiens were clever in a way that Neanderthals were not. Perhaps most importantly, they were armed with much more effective weapons. Within about 5,000 years our species had spread and multiplied so effectively that it may have outnumbered the Neanderthals 10 to one. Not long afterwards the Neanderthals vanished entirely', 1, 5, 6, 'images/image131.jpg'),
(7, 'African music', 'In Africa everything related to music has been passed on orally.', 'A simple series of spoken sounds for teaching the rhythms of the hand-drum, using six vocal sounds for three basic sounds on the drum, each played with either the left or the right hand.', 0, 12, 7, 'images/yemaya.jpg'),
(8, 'Brasilian Music', 'Nowadays, guidelines of both experimentalism and traditional music.', 'The music of Brazil encompasses various regional music styles influenced by African, European and Amerindian forms. After 500 years of history, Brazilian music developed some unique and original styles such as samba, bossa nova, MPB, sertanejo, pagode, tropicalia, choro, maracatu, embolada (coco de repente), mangue beat, funk carioca (in Brazil simply known as Funk), frevo, forró, axé, brega, lambada, and Brazilian versions of foreign musical genres, such as Brazilian rock and rap.', 0, 69, 8, 'images/Samba.jpg'),
(9, 'Greece', 'Music Of Greece from the beginning until today', 'The music of Greece is as diverse and celebrated as its history. Greek music separates into two parts: Greek traditional music and Byzantine music, with more eastern sounds.', 1, 50, 9, 'images/image49.jpg');
