(1, 1, 'Comfortably enjoy from home', 'fa-heart', 'Opportunity for new artists', 'Plan and book your online trip with Kike.box. More than 200 million views, comments and photos of destinations, businesses attractions and more. Not surprisingly, people consult Skapada before booking for real.', 'page.php', 'fa-calendar', 'Whenever you want', 'With Skapada, you have your account wherever you feel at home. All you need to "flight away" is to feel comfortable with your computers, smartphone or tablet and a fast internet connection', 'page.php', 'fa-globe', 'Around the world', 'Travel wherever you want as long as you want. The world of Kike.box has no borders. Is not sunny and you have not holidays? No problem, we bring you today to the Caribbean and tomorrow you will be at the office', 'page.php', 'fa-envelope-o', 'Another text', 'Travel wherever you want as long as you want. The world of Kike.box has no borders. Is not sunny and you have not holidays? No problem, we bring you today to the Caribbean and tomorrow you will be at the office', 'page.php');
