(1, 'Browse our categories', 'The pleasure of music', 'More than 16 million active music enthusiasts use Kike.box. The world was never so small. Do you want to experience that concert in the other side of the globe? Kike.box make it possible.', 'Learn more', 'Your Oportunity', 'Do you have a garage Band? Reach more than 70 million potential fans worldwide. Win their attention and make money selling live concerts online. Kike.box is the most popular method of making your music known.', 'Learn more', 'Jamming together', 'Are you studying chinese ceramic but you live in Argentina. No problem, visit museums thousands of miles away, listen the explanatioon directly from local experts and impress with a nice presentation at the University.', 'Learn more');
