(3, 'Life is great in Havana: Answer from Douglas (user5)', '  <h3>Vitrola is the best restauran, ever</h3>\n\n                                        <p>The capital of Cuba is Havana, the capital of Havana we, the people of the barrio, knows is in Old Havana. The heart of the Old Havana beats in Plaza Vieja with its hive of new and not so new businesses. And if we ask: where to have the best time, the answer today is unanimous: in the restaurant Paladar La Vitrola.\n\nHavana gradually rescue the traditional culinary culture of the island by incorporating new businesses. In my trip to the city I have visited both new and old renewed premises with the aim to discover new gems in the face of the island. I confess it was a great experience to discover the secrets of the city where I was born, witness how it renew and adapt itself to more and more demanding clientele.\n\nThat is the case of the Restaurant “Paladar” La Vitrola, strategically located in a corner of the Plaza Vieja of the old city. Somebody recommended it to us in a in town as far as Santa Clara about 300 km away in the center of the island. It was easy to find it, because despite the great variety of businesses that overlook the square and the musical hubbub that from each emanates; La Vitrola is perhaps the only place in Cuba where foreign tourists and locals await in the same line to enter and occupy one of their tables. Either to begin the day with a hearty breakfast; or on New Year’s Eve.\n\n<H2> Top Cuba restaurant: Restaurant Paladar La Vitrola </h2>\nWhat is special about this new Victrola? Everything and nothing.\nLet’s say it straight: The Victrola does not recreate the cheerful 50s Cuba, but just rescued the joy of the best epoch of Havana. Whether for its decoration that picks up a little here and there. Old stuff, mixed with Benny Moré and Aragon’s music and seasoned with the feeling of being at the house of our childhood (at least for us older Cubans). There is not place there for clichés like "Chan Chan", "Guantanamera" or "Comandante Che Guevara", unless some confused tourist asks for it.\n\nBut not that these details deface a place well above the average of services in Havana. We were more than pleased to be the New Year’s Eve at La Vitrola, perhaps the best restaurant on the island today.\n\n                                        </p>\n                                        <p class="small">\n                                            <strong>Best regards, Douglas</strong>\n                                        </p>', 'Vitrola restaurant is Amazing', '2016-04-18 17:56:50', 5, 1, 1, 0, 1),
